#define VIRTUAL_MATRIX_CHAIN_TYPE CHAIN_BOTTOM_LEFT_UP

struct rgb24
{
    uint8_t r;
    uint8_t g;
    uint8_t b;
};

rgb24 hue2rgb(uint8_t hue)
{ // saturation and value are fixed at 255
    rgb24 rgb;
    uint8_t h = hue;
    uint8_t i = h / 43;             // i is the sector 0..5 around the color wheel
    uint8_t p = (h - (i * 43)) * 6; // p is the position in sector
    uint8_t q = 255 - p;            // q is the opposite percentage of p
    switch (i)
    {
    case 0:
        rgb.r = 255;
        rgb.g = p;
        rgb.b = 0;
        break;
    case 1:
        rgb.r = q;
        rgb.g = 255;
        rgb.b = 0;
        break;
    case 2:
        rgb.r = 0;
        rgb.g = 255;
        rgb.b = p;
        break;
    case 3:
        rgb.r = 0;
        rgb.g = q;
        rgb.b = 255;
        break;
    case 4:
        rgb.r = p;
        rgb.g = 0;
        rgb.b = 255;
        break;
    case 5:
        rgb.r = 255;
        rgb.g = 0;
        rgb.b = q;
        break;
    }
    return rgb;
}

void setup()
{
    // Serial.begin(115200);
    // delay(1000);
    // Serial.println("Starting...");

    HUB75_I2S_CFG mxconfig(
        PANEL_RES_X,
        PANEL_RES_Y,
        PANEL_CHAIN);
    mxconfig.i2sspeed = mxconfig.HZ_20M;
    mxconfig.driver = mxconfig.SHIFTREG;
    mxconfig.clkphase = false;
    mxconfig.latch_blanking = 1;
    // mxconfig.double_buff = true;

    dma_display = new MatrixPanel_I2S_DMA(mxconfig);

    dma_display->setBrightness8(192); // range is 0-255, 0 - 0%, 255 - 100%

    // Allocate memory and start DMA display
    if (not dma_display->begin())
        Serial.println("****** !KABOOM! I2S memory allocation failed ***********");

    virtualDisp = new VirtualMatrixPanel((*dma_display), NUM_ROWS, NUM_COLS, PANEL_RES_X, PANEL_RES_Y, VIRTUAL_MATRIX_CHAIN_TYPE);
    virtualDisp->fillScreen(virtualDisp->color444(0, 0, 0));
}

